import {Nav, LinkContainer} from 'react-bootstrap';
import { Outlet } from 'react-router-dom';


const Dashboard = () => {
    return (
        <>
        <Navbar/>
        <Outlet/>
        </>
    )
}

export default Dashboard;



function Navbar() {
  return (
    <>
      <Nav className="justify-content-center" fill variant="tabs">
        <Nav.Item>
          <Nav.Link to="/home">Home</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <NavLink to="/home/registration">Register</NavLink>
        </Nav.Item>
        <Nav.Item>
          <NavLink to="/course/running">Running Courses</NavLink>
        </Nav.Item>
      </Nav>
    </>
  );
}
